class Solution(object):
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        s , t = list(s), list(t)
        while s:
            t.remove(s[0])
            s.remove(s[0])
        return t[0]




